#!/usr/bin/env python3

DNA=''

DNA1=DNA.replace('T', 't').replace('A','T')
DNA2=DNA1.replace('t', 'A').replace('C','c')
DNA3=DNA2.replace('c','g').replace('G', 'C')

DNA4=DNA3.upper()

revers_comp=DNA4[::-1]

print(f'{DNA[0:5]}: This is the begining of DNA seq')
print(f'{DNA4[0:5]}: This is the begining of complement seq')
print(f'{DNA4[-5:]}: This is the end of the complement seq')
print(f'{revers_comp[0:5]}: This is the begining of the rev complement seq')


complement=''
for base in DNA:
  if base=='T':
   complement+='A'
  if base=='A':
   complement+='T'
  if base=='C':
   complement+='G'
  if base=='G':
   complement+='C'
print(complement[:5])


